(null,"13367","","304","post","Eshopy","<WWW_PATH>servis","0","0","","","3274","2017-04-06 10:57:05","2019-02-25 13:32:51","2017-04-06 10:57:00","0","<p>Nepracujeme &scaron;t&yacute;lom, že stiahneme &scaron;ablonu a napln&iacute;me eshop. Pracujeme&scaron;t&yacute;lom, v ktorom vyvinieme eshop od z&aacute;kladou. V r&aacute;mci platformy dnt3 vieme poskytn&uacute;ť kompletn&yacute; servis.</p>\n","","","","","","0","1","eshopyservisnepracujemestylomzestiahnemesablonuanaplnimeeshoppracujemestylomvktoromvyviniemeeshopodzakladouvramciplatformydnt3viemeposkytnutkompletnyservis","0","57","0"),
