(null,"14853","","290","sitemap","Firma","firma","0","0","homepage","","","2019-02-22 21:30:11","2019-02-26 23:04:46","2019-02-22 21:30:00","0","","<p><span style=\"font-size:16px\">Sme firma, ktor&aacute; programuje <strong>srdcom</strong>, na&scaron;e weby použ&iacute;vaj&uacute; <strong>mili&oacute;ny ľud&iacute;</strong>, na&scaron;&iacute;mi datab&aacute;zami pre&scaron;lo viac ako <strong>2mili&oacute;ny registracii</strong>, odoslali sme viac ako <strong>100tis&iacute;c</strong> newslettrov. Spracovali sme cez <strong>5000 </strong>bankov&yacute;ch transakcii.&nbsp;Vďaka <strong>milion min&uacute;tam </strong>prehrat&yacute;ch videi sme v <strong>mnoh&yacute;ch </strong>dom&aacute;cnostiach spr&iacute;jemnili zimn&eacute; večery a vyčarili sme <strong>nespočetne </strong>veľa &uacute;primn&yacute;ch &uacute;smevov.&nbsp;</span></p>\n\n<p><span style=\"font-size:16px\">Pracujeme s r&ocirc;znymi modern&yacute;mi technol&oacute;giami, ktor&eacute; s&uacute; použ&iacute;van&eacute; vo webovom priemysle. Za t&yacute;mto &uacute;čelom sme vyvinuli vlastn&yacute; redakčn&yacute; syst&eacute;m pod n&aacute;zvom Designdnt. Jadrom tohoto syst&eacute;mu je nami nap&iacute;san&yacute; objektovo orientovan&yacute; framework dnt3. </span></p>\n\n<p><span style=\"font-size:16px\">Z&aacute;kladom syst&eacute;mu bola použ&iacute;vateľsk&aacute; jednoduchosť, r&yacute;chlosť a v neposlednom rade intuit&iacute;vnosť. Cel&eacute; CMS sme zjednotli a vyvinuli mulifonkčn&uacute; platformu, pod ktorou vieme vivin&uacute;ť naozaj čokoľvek. </span></p>\n\n<p><span style=\"font-size:16px\">Vďaka dlhodob&eacute;mu v&yacute;voju sa n&aacute;m podarilo vypracovať presne to, čo je perfektn&yacute;m z&aacute;kladom pre weby, webov&eacute; aplik&aacute;cie a informačn&eacute; syst&eacute;my.</span></p>\n\n<p><span style=\"font-size:16px\">Nadobudli sme veľa sk&uacute;senost&iacute; z komerčn&yacute;ch firiem, ako napr&iacute;klad Triad, PS Digital, Tv Mark&iacute;za, eFabria, Comsultia. Taktiež sme veľa inform&aacute;cii a produktov do t&yacute;chto firiem vložili. Napr&iacute;klad v TV Mark&iacute;za sme vyv&yacute;jali kompletn&yacute; web. </span></p>\n\n<p><span style=\"font-size:16px\">Proces developmentu sme &scaron;tandardizovali podľa bežn&yacute;ch firem&yacute;ch &scaron;trukt&uacute;r. Pri developmente použ&iacute;vame n&aacute;stroje ako <strong>Git</strong>, <strong>Gulp</strong>, <strong>Apache</strong>, <strong>Linux</strong>, <strong>Bamboo</strong>, <strong>MantisBT</strong></span></p>\n\n<ol>\n	<li><span style=\"font-size:16px\">Multidom&eacute;nov&aacute; a multiwebov&aacute; platforma</span></li>\n	<li><span style=\"font-size:16px\">R&ocirc;zny počet presmerovan&iacute;</span></li>\n	<li><span style=\"font-size:16px\">Neobmedzen&yacute; multilanguage</span></li>\n	<li><span style=\"font-size:16px\">Neobmedzen&yacute; počet str&aacute;nok a podstr&aacute;nok</span></li>\n	<li><span style=\"font-size:16px\">Modulov&aacute; &scaron;trukt&uacute;ra</span></li>\n	<li><span style=\"font-size:16px\">OOP n&aacute;vrh</span></li>\n	<li><span style=\"font-size:16px\">API interface</span></li>\n	<li><span style=\"font-size:16px\">inteligentn&eacute;&nbsp;URL adresy s chronologickou postupnosťou</span></li>\n	<li><span style=\"font-size:16px\">autoredirector</span></li>\n	<li><span style=\"font-size:16px\">vlastn&eacute; media library</span></li>\n	<li><span style=\"font-size:16px\">content manager</span></li>\n	<li><span style=\"font-size:16px\">analysis manager</span></li>\n</ol>\n\n<p><span style=\"font-size:16px\">Po dobu viac ako 6 rokov sa neust&aacute;le venujeme jedn&eacute;mu produktu a t&yacute;m je na&scaron;a platforma. Platforma, ktor&aacute; je nap&iacute;san&aacute; tak, aby pom&aacute;hala ľuďom.</span></p>\n\n<p><span style=\"font-size:16px\">Made by heart, developed by skills.</span></p>\n","","","","","10","1","","0","57","0"),
(null,"14854","","290","sitemap","Development","development","0","0","singl_page_progress","","3296","2019-02-22 21:31:08","2019-02-26 22:50:37","2019-02-22 21:31:00","0","<p>M&aacute;me jednoduch&eacute; a jasn&eacute; firemn&eacute; procesy, ktor&eacute; n&aacute;s nezdržuj&uacute; v tom, čo radi rob&iacute;me. V na&scaron;om kolekt&iacute;ve s&uacute; ľudia, ktor&iacute; s&uacute; pohodov&iacute; a nepreferuj&uacute; stres a krik. Dodržiavame &scaron;tandardn&yacute; proces v&yacute;voja, testovania a release deploymentu. Z&aacute;roveň podporujeme open-source technol&oacute;gie a otvoren&eacute; &scaron;tandardy. Pracujeme na&nbsp;v&auml;č&scaron;&iacute;ch a zauj&iacute;mva&yacute;ch projektoch pre atrakt&iacute;vnych klientov.</p>\n\n<p>Pred začat&iacute;m každ&eacute;ho nov&eacute;ho projektu najprc sprav&iacute;me d&ocirc;kladn&uacute; anal&iacute;zu. Nejedn&aacute; sa o stratu času, ako si m&ocirc;žu podaktor&iacute; ľudia myslieť. Jedn&aacute; sa naozaj o to, aby sme požiadavku klienta vedeli čo najlep&scaron;ie zapracovať v r&aacute;mci &scaron;tandardoc, ktor&eacute; použ&iacute;vame. Veľa kr&aacute;t sa m&ocirc;že zdať požiadavka pre klienta veľmi trivi&aacute;lna, ale po hlb&scaron;ej anal&iacute;ze sa zist&iacute;, že n&aacute;sledn&aacute; implement&aacute;cia ovplivn&iacute; mnoho ďal&scaron;&iacute;ch krokov a procesov.</p>\n\n<p>Na&scaron;ou hlavnou &uacute;lohou je vyv&iacute;jať internetov&eacute; aplik&aacute;cie na dnt3 frameworku, navrhovať vlastn&eacute; a inovat&iacute;vne rie&scaron;enia a to tak, aby sme vedeli zabezpečiť&nbsp;support a roz&scaron;irovanie aplik&aacute;cie bud&uacute;cna.</p>\n","<p>Samotn&yacute; proces developmentu sme preto rozdelili do 9 logick&yacute;ch bodov, ktor&eacute; striktne dodržiavame.&nbsp;</p>\n","","","","","9","1","","0","57","0"),
