(null,"14856","","290","sitemap","Platforma dnt3","platforma-dnt3","0","0","singl_page","","3293","2019-02-22 21:54:53","2019-02-27 00:23:20","2019-02-22 21:54:00","0","<p>Platforma, čo to vlastne je? V na&scaron;om pon&iacute;man&iacute; je platforma pojem pre komplexn&uacute; webov&uacute; aplik&aacute;ciu. Aplik&aacute;cia ako celok je len samotn&aacute; webov&aacute; aplik&aacute;cia, ktor&aacute; m&aacute; nejak&yacute; frontend a backend. My sa bav&iacute;me ale o <strong>platforme</strong>. To je vlastne cel&aacute; symbi&oacute;za uzatvoren&eacute;ho syst&eacute;mu, ktor&aacute; sa sklad&aacute; zo <strong>&scaron;trukt&uacute;ry datab&aacute;zy dnt_, </strong>frameworku <strong>dnt3, </strong>redakčn&eacute;ho syst&eacute;mu<strong> Designdnt3,&nbsp;</strong>webov&eacute;ho rozhrania <strong>CMS3&nbsp;</strong>a samotn&eacute;ho <strong>webov&eacute;ho prostredia</strong>, ktor&eacute; je buď v <strong>produkčnom prostred&iacute;</strong>, alebo <strong>developersom prostred&iacute;</strong>. S&uacute;časťou platformy s&uacute; aj developersk&eacute; n&aacute;stroje, ako napr&iacute;klad <strong>gulp</strong>, <strong>git</strong>, alebo <strong>MantisBT</strong>.</p>\n\n<p>Cel&yacute; v&iacute;voj platformy vedieme nastaven&yacute;m &scaron;tandardom <strong>DNT-3, </strong>ktor&yacute; už dodržiavame 6 rokov. V r&aacute;mci pr&iacute;snych konvecii a &scaron;tandardov sa n&aacute;m dar&iacute; držať krok s dobou, promtne reagovať na požiadavky klientov a viv&iacute;jať aktu&aacute;lny projekt.</p>\n\n<p>Každ&yacute; jeden web, ktor&yacute; sme robili od z&aacute;kladov a je ich už viac ako 30, sme p&iacute;sali pod platformou <strong>dnt3</strong>.<strong>&nbsp;</strong>Každ&yacute; projekt je &scaron;pecifick&yacute;, každ&yacute; z&aacute;kazn&iacute;k m&aacute; in&eacute; požiadavky, každ&yacute; z&aacute;akzn&iacute;k m&aacute; ib&eacute; predstavy o tom, ako by veci mali fungovať. My sa snaž&iacute;me držať ist&eacute; konvencie, ale nie vždy je to &uacute;plne ide&aacute;lne, preto, že slovo z&aacute;kazn&iacute;ka je pre n&aacute;s sv&auml;t&eacute; slovo :-)</p>\n","","","","","","8","1","platformadnt3platformadnt3platformacotovlastnejevnasomponimanijeplatformapojemprekomplexnuwebovuaplikaciuaplikaciaakocelokjelensamotnawebovaaplikaciaktoramanejakyfrontendabackendmysabavimealeoplatformetojevlastnecelasymbiozauzatvorenehosystemuktorasaskladazostrukturydatabazydnt_","0","57","0"),
(null,"14857","","290","sitemap","CMS Designdnt3","cms-designdnt3","0","0","singl_page","","3298","2019-02-22 21:56:16","2019-02-26 00:51:18","2019-02-22 21:56:00","0","<p>Redakčn&yacute; syst&eacute;m je n&aacute;stroj na spr&aacute;vu webovej aplik&aacute;cie. V dne&scaron;nej dobe je mnoho free redakčn&yacute;ch syst&eacute;mov, ktor&eacute; v konečnom d&ocirc;sledku bežn&eacute;mu z&aacute;kaznikovi pr&aacute;cu sk&ocirc;r sťažia, ako uľachčia, keďže v&yacute;voj&aacute;ri pri vyv&iacute;jan&iacute; optimalizuj&uacute; požiadavky pre cel&yacute; svet a pre ich komerčn&eacute; použitie. Rozhodnutie nap&iacute;sať vlastn&yacute; redakčn&yacute; syst&eacute;m padlo vtedy, keď som sa začal profesion&aacute;lne venovať z&aacute;kazkov&eacute;mu programovaniu, kde bolo treba do detajlov optimalizovať logick&eacute; požiadavky z&aacute;kazn&iacute;kov.</p>\n\n<p>Postupom času som jednotliv&eacute; časti dal dokopy a prerobil jadro syst&eacute;mu tak, aby jednotliv&eacute; moduly spolu komunikovali. V&yacute;sledkom je Tretia verzia Redakčn&eacute;ho syst&eacute;mu Designdnt. Cel&yacute; proces v&yacute;voja sa zdokonaľoval vďaka z&aacute;kazn&iacute;kom a ich požiadavk&aacute;m. V&yacute;voj trval zhruba dva a pol roka. V dne&scaron;nej dobe spĺňa Designdnt 3 asi v&scaron;etky požiadavky, ktor&eacute; klient požaduje, rsp. po mal&yacute;ch zmen&aacute;ch ich viem r&yacute;chlo dorobiť/obmeniť.</p>\n","","","","","","7","1","","0","57","0"),
