(null,"14859","","290","sitemap","Kontakt","kontakt","0","0","contact","","3070","2019-02-22 21:57:13","2019-02-26 23:42:54","2019-02-22 21:57:00","0","<p>Kontaktujte n&aacute;s ohľadom čohokoľvek, čo V&aacute;s zauj&iacute;ma. Nev&aacute;hajte a kľudne sa n&aacute;s sp&yacute;tajte, radi odpovieme každ&eacute;mu n&aacute;&scaron;mu potencialn&eacute;mu klientovi, alebo obyčajn&eacute;mu n&aacute;v&scaron;tevn&iacute;kovi str&aacute;nky, ktor&yacute; si &quot;mapuje ter&eacute;n&quot;.</p>\n","","","","","","3","1","kontaktkontaktkontaktujtenasohladomcohokolvekcovaszaujimanevahajteakludnesanasspytajteradiodpoviemekazdemunasmupotencialnemuklientovialeboobycajnemunavstevnikovistrankyktorysimapujeteren","0","57","0"),
(null,"14862","14854","291","sitemap","Programátor","programator","0","0","singl_page","","3329","2019-02-22 22:33:36","2019-02-27 22:59:01","2019-02-22 22:33:00","0","<p>Programovaniu sa venujem akt&iacute;vne od roku 2012, kedy som začal p&iacute;sať prv&uacute; verziu CMS Designdnt3. Popri &scaron;t&uacute;diu na aplikovanej informatike som &uacute;spe&scaron;ne dokončil mnoho webov&yacute;ch projektov. Z anal&iacute;zy vyplynulo, že treba nap&iacute;sať nov&eacute; CMS, ktor&eacute; nebude len ako CMS, aleb bude ako kompletn&aacute; platforma, pre klientelu, nakoľko bolo treba udržiavať nap&iacute;san&yacute; k&oacute;d&nbsp;<strong>up to date.</strong></p>\n\n<p>V&nbsp;roku 2015 som začal p&iacute;sať platformu <strong>dnt3</strong>, pod ktorou bolo nap&iacute;san&eacute; CMS <strong>Designdnt3</strong>. V tomto roku som sa stal hlavn&yacute;m v&iacute;voj&aacute;rm pre Designdnt a s&uacute;čsne som od tohoto roku zamestnan&yacute; ako v&iacute;voj&aacute;r pre&nbsp;<strong>TV mark&iacute;za</strong> s n&aacute;v&scaron;tevnosťou webu viac ako <strong>200000 n&aacute;v&scaron;tevn&iacute;kov</strong> za deň. Na z&aacute;klade nov&yacute;ch sk&uacute;senost&iacute;, ktor&yacute;ch bolo fakt mnoho som v roku 2016 cel&uacute; platformu prep&iacute;sal na nov&uacute; verziu, ktor&aacute; disponovala vy&scaron;&scaron;iou r&yacute;chlosťou a čistej&scaron;&iacute;m k&oacute;dom, T&aacute;to verzia fungovala skoro 2 roky.&nbsp;</p>\n\n<p>Koncom roka 2018 už padlo ďal&scaron;ie strategick&eacute; rozhodnutie a to pozmeniť logiku aktu&aacute;lnej platformy <strong>dnt3</strong>. V tejto verzii&nbsp;sme už pridali datab&aacute;zov&eacute; exporty a importy, &nbsp;spolu s d&aacute;tami, vytvorili in&scaron;talačn&yacute; script pre použ&iacute;vateľov a&nbsp;zoptimalizovali k&oacute;rov&yacute; framework dnt-library. Taktiež pribudli <strong>cron-job</strong> &uacute;lohy, zlep&scaron;ili sme engine pre cachovanie contentu a mnoho ďaľ&scaron;&iacute;ch features, ktor&eacute; s&uacute;&nbsp;&nbsp;pop&iacute;san&eacute; detailnej&scaron;ie v sekcii o platforme.</p>\n","","","","","","0","1","","0","57","0"),
