(null,"14977","","1077","post","Markíza.sk","http://markiza.sk","0","0","","","3335","2019-02-26 13:18:39","2019-02-27 23:37:00","2019-02-26 13:18:00","0","<p>Dynamick&yacute; web, do ktor&eacute;ho denne pribudne cca 50 čl&aacute;nkov a n&aacute;v&scaron;tevnosť sa pohybuje okolo 200.000 už&iacute;vateľov/deň. Pri tak&yacute;chto weboch nie je priestor na chyby a každ&aacute; jedna znamen&aacute; dokonal&uacute; anal&iacute;zu a premyslenie krokov, čo sa ako bude robiť. Web&nbsp;Markiza.sk pre&scaron;iel už tret&iacute;m redesignom. Aktu&aacute;lne je už verzia 3.0. V roku 2016&nbsp;sme p&iacute;sali verziu 2.0 pod platformou Cyclone3 a v roku 2018 sme nap&iacute;sali 3.0. V r&aacute;mci platformy m&aacute;me 3 frontendov&eacute; servery, 2 datab&aacute;zov&eacute;,&nbsp;2 backendov&eacute; servery a 1 developersk&yacute;. Web disponuje video obsahom, content obsahom. Taktiež web m&ocirc;že obsahovať rozne druhy listingov, r&ocirc;zne ankety a kv&iacute;zy. Je to jeden z najv&auml;č&scaron;&iacute;ch projektov, ktor&yacute; sa vyv&iacute;ja každ&yacute; deň a každ&yacute; deň sa prid&aacute;vaj&uacute; nov&eacute; a nov&uacute; funkcionality. V r&aacute;mci platformy vieme spraviť&nbsp;čokoľvek, čo klient požaduje. Groo logiky je postaven&eacute; na cachovan&iacute;, použ&iacute;vam&eacute; modulov&eacute; cachovanie a Varnish.</p>\n","","markiza,","","","","0","1","","0","57","0"),
