(null,"14980","","1077","post","videoarchiv.markiza.sk","http://videoarchiv.markiza.sk","0","0","","","3332","2019-02-26 13:39:09","2019-02-27 23:37:32","2019-02-26 13:39:00","0","<p>VOD platforma, ktor&aacute; si pre&scaron;la tiež svojou cestou. Osobne m&aacute;m k nej veľk&yacute; citov&yacute; vzťah, nakoľko posledn&uacute; verziu 4.0 som robil s veľk&yacute;mi sk&uacute;senosťami a rozhodol som sa vyhrať s tak&yacute;mi vecmi, ako bol napr&iacute;klad progres&iacute;vne vyhľad&aacute;vanie. V r&aacute;mci progres&iacute;vneho vyhľad&aacute;vania sme rie&scaron;ili optimaliz&aacute;ciu statick&eacute;ho jsonu. Taktiež bola veľk&aacute; &uacute;loha vyrie&scaron;iť roztriedenie logick&eacute; videoobsahu.</p>\n","","markiza","","","","0","1","","0","57","0"),
(null,"14981","","1077","post","Tvnoviny.sk","http://tvnoviny.sk","0","0","","","3303","2019-02-26 13:42:38","2019-02-27 23:37:45","2019-02-26 13:42:00","0","<p>Dynamick&yacute; web, do ktor&eacute;ho denne pribudne cca 50 čl&aacute;nkov a n&aacute;v&scaron;tevnosť sa pohybuje okolo 200.000 už&iacute;vateľov/deň. Pri tak&yacute;chto weboch nie je priestor na chyby a každ&aacute; jedna znamen&aacute; dokonal&uacute; anal&iacute;zu a premyslenie krokov, čo sa ako bude robiť. Web&nbsp;Tvnoviny.sk pre&scaron;iel už druh&yacute;m redesignom. Aktu&aacute;lne je už verzia 3.0. V roku 2016&nbsp;sme p&iacute;sali verziu 2.0 pod platformou Cyclone3 a v roku 2018 sme nap&iacute;sali 3.0. V r&aacute;mci platformy m&aacute;me 3 frontendov&eacute; servery, 2 datab&aacute;zov&eacute;,&nbsp;2 backendov&eacute; servery a 1 developersk&yacute;. Web disponuje video obsahom, content obsahom. Taktiež web m&ocirc;že obsahovať rozne druhy listingov, r&ocirc;zne ankety a kv&iacute;zy. Je to jeden z najv&auml;č&scaron;&iacute;ch projektov, ktor&yacute; sa vyv&iacute;ja každ&yacute; deň a každ&yacute; deň sa prid&aacute;vaj&uacute; nov&eacute; a nov&uacute; funkcionality. V r&aacute;mci platformy vieme spraviť&nbsp;čokoľvek, čo klient požaduje. Groo logiky je postaven&eacute; na cachovan&iacute;, použ&iacute;vam&eacute; modulov&eacute; cachovanie a Varnish. K webu vy&iacute;jame aj mobiln&uacute; aplik&aacute;ciu pre iOS a Android.</p>\n","","markiza","","","","0","1","","0","57","0"),
(null,"14982","","1077","post","hybsa.markiza.sk","http://hybsa.markiza.sk","0","0","","","3333","2019-02-26 13:48:47","2019-02-27 23:43:03","2019-02-26 13:48:00","0","<p>Projekt Hybsa Slovensko bol jeden z najv&auml;č&scaron;&iacute;ch &quot;&scaron;katulov&yacute;ch projektov&quot;. Boli sme s&uacute;časťou od prv&eacute;ho meetingu, až po samotn&uacute; z&aacute;verečn&uacute; technick&uacute; organiz&aacute;ciu. Na&scaron;ou &uacute;lohou bol navrhn&uacute;ť a vivin&uacute;ť informačn&yacute; syst&eacute;m registr&aacute;cie s&uacute;ťažiacich tak, aby sme v deň konania eventu vedeli odprezentovať cez 1000det&iacute; za akciu. Platby prebiehali cez platobn&uacute; br&aacute;nu, cez platobn&yacute; termin&aacute;m v Bille a na mieste. V&scaron;etko to naprojektovať tak, aby n&aacute;m &uacute;d&aacute;je a d&aacute;ta sedeli nebolo jednoduc&eacute;, nakoľko sme m&aacute;li času a dynamika r&ocirc;znych discipl&iacute;n boľa &scaron;irokospektr&aacute;lna. Podporobvali sme:</p>\n\n<ol>\n	<li>Platbu cez platobn&uacute; br&aacute;nu</li>\n	<li>Platbu cez platobn&yacute; termin&aacute;l</li>\n	<li>Platby na mieste</li>\n	<li>Zohľadňovali sme hromadn&eacute; zľavy</li>\n	<li>Podporovali sme zľavov&eacute; kup&oacute;ny</li>\n	<li>Podporovali sme pr&iacute;stup do administr&aacute;cie pre organiz&aacute;torov pod r&ocirc;znymi už&iacute;vateľsk&yacute;mi roľami</li>\n	<li>V re&aacute;lnom čase sme zbierali a validovali možnosti registr&aacute;cie, nakoľko boli nastaven&eacute; limity pre descipl&iacute;ny.</li>\n</ol>\n\n<p>Bolo toho veľa, čo sme rie&scaron;ili a čo sa n&aacute;m podarilo naprogramovať. V tomto pr&iacute;pade sa naozaj prejavila t&iacute;mov&aacute; spolupr&aacute;ca kvalitn&yacute;ch program&aacute;torv, ktor&iacute; nemaj&uacute; cit len na k&oacute;d, ale aj na logick&eacute; a analitick&eacute; myslenie. Na z&aacute;ver v&scaron;etk&yacute;ch k&ocirc;l sme žrebovali so v&scaron;etk&yacute;ch s&uacute;ťažiacich v&yacute;hercu hlavnej ceny - <strong>osobn&yacute; automobil</strong>. Na to sme museli splniť&nbsp;určit&eacute; technick&eacute; regule tak, aby sme boli opr&aacute;vnen&iacute; spolu s not&aacute;rkou toto žrebovanie uskutočniť.</p>\n","","markiza,informacny-system,payment","","","","0","1","","0","57","0"),
(null,"14983","","1077","post","Kalendáre","http://vianoce.markiza.sk","0","0","","","3336","2019-02-26 14:11:52","2019-02-27 23:38:24","2019-02-26 14:11:00","0","<p>Mark&iacute;za rie&scaron;i veľa s&uacute;ťaž&iacute; počas roka. No od roku 2014 sa stalo pravidelnosťou, že každ&yacute; rok je <strong>Vianočn&yacute; kalend&aacute;r</strong> a cez Veľk&uacute; noc <strong>Veľkonočn&yacute; kalend&aacute;r</strong>. Každ&yacute; z t&yacute;cho kalend&aacute;rov m&aacute; určit&yacute; počet pol&iacute;čok a v každom pol&iacute;čku je jedna denn&aacute; v&yacute;hera, ktor&aacute; sa losouje vždy na druh&yacute; deň v priamom prenose v Teler&aacute;ne.Na konci celej s&uacute;ťaže sa žrebuje glavn&aacute; cena, taktiež v priamom prenose v Teler&aacute;ne.&nbsp;Na&scaron;ou &uacute;lohou bolo cel&yacute; proces vivin&uacute;ť tak, aby bol automatizovan&yacute;.</p>\n\n<ol>\n	<li>Design od grafika sme nakodovali</li>\n	<li>Vivinuli sme službu&nbsp;na <strong>registr&aacute;ciu</strong>&nbsp;<strong>s&uacute;ťažiacich</strong></li>\n	<li>Vivinuli sme službu na automatick&uacute; &quot;pretočenie&quot;&nbsp;kalend&aacute;ra &quot;<strong>pretočenie kalend&aacute;ra na ďal&scaron;&iacute; deň po polnoci</strong>&quot;</li>\n	<li>Vivinuli sme službu na automatick&eacute; vyžrebovanie v&yacute;hercu dennej ceny zo spr&aacute;vnych odpoved&iacute;</li>\n	<li>T&uacute;to službu použ&iacute;vaj&uacute; v Teler&aacute;ne na vyťrebovanie v&iacute;ťaza hlavnej ceny</li>\n	<li>Vivinuli sme službu na automatick&yacute; z&aacute;pis v&yacute;hercu do viditeľn&eacute;ho poľa&nbsp; v r&aacute;mci kalend&aacute;ra hneď po vyžrebovan&iacute;.</li>\n	<li>Vivinuli sme službu na rozosielanie &quot;Thank you&quot; emailov</li>\n	<li>Naprogramovali sme design pre informačn&yacute; email a naprogramovali sme službu pre automatick&eacute; odosielanie newslettrov.</li>\n</ol>\n\n<p>Cel&yacute; projekt bolo veľmi n&aacute;ročn&eacute; vivin&uacute;ť, nakoľko m&aacute;me denne okolo 20.000 registr&aacute;cii a requesty na datab&aacute;zu prich&aacute;dzaj&uacute; každ&yacute;ch 4,32sekundy a to aj počas noci. Od roku 2014 m&aacute;me v datab&aacute;ze celkovo viac ako 1,5mili&oacute;na už&iacute;vateľov. S&uacute; to naozaj č&iacute;sla, ktor&eacute; su &quot;Big Data&quot;. Z t&yacute;chto č&iacute;sel rob&iacute;me r&ocirc;zne reporty a anal&iacute;zy, ktor&eacute; sa t&yacute;kaj&uacute; napr&iacute;klad cielenia reklamy.</p>\n","","markiza,informacny-system,dnt3","","","","0","1","","0","57","0"),
