(null,"14997","","1077","post","team4tourism - crosscafe","https://crosscafe-salzburg.eu/","0","0","","","3319","2019-02-26 16:24:59","2019-02-27 23:44:45","2019-02-26 16:24:00","0","<p>Pre medzin&aacute;rodn&uacute;&nbsp;firmu&nbsp;<strong>team4tourism,&nbsp;</strong>ktor&aacute; p&ocirc;sob&iacute; v&nbsp;<strong>Česku</strong>,&nbsp;<strong>Nemecku</strong>,&nbsp;<strong>Rak&uacute;sku</strong>,&nbsp;<strong>Poľsku</strong>,&nbsp;<strong>Holandsku&nbsp;</strong>a&nbsp;<strong>D&aacute;nsku&nbsp;&nbsp;</strong>sme vivinuli platformu v r&aacute;mci ktorej&nbsp;je možn&eacute; vytvoriť web podľa svoj&iacute;ch predst&aacute;v. Weby sl&uacute;žia na propag&aacute;ciu regi&oacute;nov.&nbsp;Spojili sme to najlep&scaron;ie, čo vieme a nap&iacute;sali platformu, ktor&aacute; je multi-univerz&aacute;lna. N&aacute;&scaron; z&aacute;kazn&iacute;k m&aacute; pod svojou platformou aktu&aacute;lne 95registrovan&yacute;ch dom&eacute;n a teda 95jedinečn&yacute;ch webov, na ktor&eacute; s&uacute; tieto dom&eacute;ny smerovan&eacute; a&nbsp;ktor&eacute; vytvoril bez toho, aby vedel programovať.&nbsp;</p>\n\n<p>P&iacute;sal sa rok 2015, kedy sme začali na tomto projekte pracovať. Po komunik&aacute;ciach a rozbehnut&iacute; biznisu sme v&nbsp;roku 2018 vivinuli &uacute;plne nov&uacute; platformu, ktor&aacute; dok&aacute;že toho e&scaron;te viac. Z&aacute;kazn&iacute;k si vie vytvoriť r&ocirc;znypočet webov, ale každ&yacute; web m&ocirc;žem mať rozny počet str&aacute;nok, ktor&eacute; m&ocirc;žu vyzerať &uacute;plne odli&scaron;ne&nbsp;a e&scaron;te m&ocirc;žu mať aj r&ocirc;zny počet jazykov&yacute;ch mutacii. V r&aacute;mci platformy s&uacute; vivinut&eacute; veci, ako napr&iacute;klad rozosielanie zľavov&yacute;ch voucherov, import a export z excelu, export registrovan&yacute;ch s&uacute;ťažiacich do excelu, export d&aacute;t z webu do .zip, import d&aacute;t zo .zip medzi platformami. Odosielanie thankyou mailov. Voliteľn&eacute; dymenzie a ploia v r&aacute;mci registračn&yacute;ch formul&aacute;rov.</p>\n","","dnt3,articles,platform,multilanguage","","","","0","1","","0","57","0"),
